import { FC } from "react";
import { OrderResponse } from "../types/order-response-type";

type TradeListProps = {
    tradeList: OrderResponse[]
}

export const TradeList: FC<TradeListProps> = ({ tradeList }) => {
    return (
        <div className="bg-white rounded-md min-h-40 w-3/4">
            <div className="flex justify-between">
                <p>Trade</p>
                <p>Order Type</p>
                <p>Asset</p>
                <p>Amount</p>
                <p>Price</p>
                <p>Total</p>
            </div>
            {
                tradeList.map((trade, idx) => {
                    return (
                        <div key={idx} className="flex">
                            {trade.side}
                            {trade.type}
                            {trade.asset}
                            {trade.quantity}
                            {trade.price}
                            {trade.notional}
                        </div>
                    )
                })
            }
        </div>
    )
}
